import RouterA from './defultComponent/router';
import { ProSidebar } from 'react-pro-sidebar';

export default function App() {
  return (
    <BrowserRouter>
                <nav>
                    <ul>
                        <li>
                            <Link to="/"> תפריט </Link>
                        </li>
                    </ul>
                </nav>
                <Router>
                    <Routes>
                        <Route path='/' element={Sidebar}/>
                        <Route path='/menu' />
                    </Routes>
                </Router>
            </BrowserRouter>
  )
}
